                "sampleid": idTest,
            };
            $.ajax({
                url: "<?php echo base_url() . 'index.php/sample/samplecontrol/getAllResultOperation' ?>",
                type: 'POST',
                dataType: 'json',
                data: dataToSend,
                success: function(data) {
                    resolve(data);
                },
                error: function(xhr, status, error) {
                    reject(error);
                }
            });
        });
    }

